import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const HeaderTabs = () => {
  return (
    <View>
      <Text>HeaderTabs</Text>
      <HeaderButton/>
    </View>
  )
}

const HeaderButton = () => {
    return (
        <View>
            <Text>Mera header button delivery pickup ke liye</Text>
        </View>
    )
}

export default HeaderTabs

const styles = StyleSheet.create({})
